            { skill: "Communication", percentage: "90%" },
            { skill: "Problem Solving", percentage: "80%" },
            { skill: "Teamwork", percentage: "85%" },
            { skill: "Time Management", percentage: "90%" }
        ]
    }
];

export const WORK_EXPERIENCE = [
    {
        title: "Senior Frontend Developer at TCS",
        date: "January 2022 - Present",
        responsibilities: [
            "Led a team of frontend developers in redesigning the company's flagship product, resulting in a 30% increase in user engagement.",
            "Implemented RESTful services and APIs for internal and external communication, improving data integration by 40%.",
            "Collaborated with frontend teams to integrate UI elements with server-side logic and database designs."
        ]
    },
    {
        title: "Backend Developer at InnovateTech",
        date: "March 2019 - December 2021",
        responsibilities: [
            "Developed and maintained scalable server-side logic for high-volume web applications, significantly reducing downtime.",
            "Implemented RESTful services and APIs for internal and external communication, improving data integration by 40%.",
            "Collaborated with frontend teams to integrate UI elements with server-side logic and database designs."
        ]
    },
    {
        title: "Software Developer at CodeWorks LLC",
        date: "June 2016 - February 2019",
        responsibilities: [
            "Participated in the full software development lifecycle, from conception to deployment, enhancing product quality.",
            "Designed and developed a project management tool that increased project delivery efficiency by 25%.",
            "Worked closely with the QA team to identify and fix software bugs, achieving a 95% issue-resolution rate."
        ]
    }
];
